import { jsPDF } from "jspdf"
var font = '';
var callAddFont = function () {
this.addFileToVFS('JosefinSans-Italic-VariableFont_wght-normal.ttf', font);
this.addFont('JosefinSans-Italic-VariableFont_wght-normal.ttf', 'JosefinSans-Italic-VariableFont_wght', 'normal');
};
jsPDF.API.events.push(['addFonts', callAddFont])
